`,"Als je een bestaand model gebruikt (zoals GPT-3), haalt de tool de totale uitstoot op uit een gegevensbestand. De tool berekent vervolgens welk deel van de uitstoot toerekenbaar is aan het gemeentelijke gebruik. Voor zelfgetrainde modellen wordt gerekend met 0,3 kg CO₂ per GPU-uur. Dit is gebaseerd op 0,4 kWh GPU-verbruik × PUE 1,56 × 481 g CO₂/kWh = 0,30 kg.",`

